const ADD_STATUS_TRUE = 'ADD_STATUS_TRUE';
const ADD_STATUS_FALSE = 'ADD_STATUS_FALSE';

const initialState = {
    statusInput: false,
    classLabel: 'classes.notActiveLabel'
};
const InputTextReducer = (state = initialState, action) => {
    switch (action.type) {
        case ADD_STATUS_TRUE:
            return {
                ...state,
                statusInput: true,
                classLabel: 'classes.ActiveLabel'
            };
        case ADD_STATUS_FALSE:
            return {
                ...state,
                statusInput: false,
                classLabel: 'classes.notActiveLabel'
            };
        default:
                return state;
    }
};

export const getStatusTrue = () => ({type:ADD_STATUS_TRUE});
export const getStatusFalse = () => ({type:ADD_STATUS_FALSE});

export const UpdateStatusTrue=()=>{
    return(dispatch)=>{
        debugger
        dispatch(getStatusTrue());
    }
};
export const UpdateStatusFalse=()=>{
    return(dispatch)=>{
        debugger
        dispatch(getStatusFalse());
    }
};
export default InputTextReducer;
